import React from 'react';
import './App.css';

function Login()
{
    return (
          
        <>
    {/* <div id="form-main"> */}
    <div id="form-div">
    <form class="form" id="form1">
      
      <p class="name">
        <input name="name" type="text" class="validate[required,custom[onlyLetter],length[0,100]] feedback-input" placeholder="Name" id="Title" />
      </p>
      
      <p class="email">
        <input name="email" type="text" class="validate[required,custom[email]] feedback-input" id="Categorized" placeholder="Email" />
      </p>
    
       
      <button type="button" class="btn btn-warning">Submit</button>
      <button type="button" class="btn btn-secondary Secondary">Reset</button>

    </form>
  </div>
  {/* </div> */}
  </>
    );
}

export default Login;
